class Solution {
    func minOperations(_ nums: [Int], _ k: Int) -> Int {
        var needed = Set(1...k) // Elements needed to find
        var bestLength = Int.max // The best (shortest) length found
        var start = 0 // Start index of the current window

        for end in 0..<nums.count {
            if needed.contains(nums[end]) {
                needed.remove(nums[end]) // Found a needed element, remove it from the set
            }

            // Try to shrink the window from the start if it still contains all 1...k
            while start <= end && needed.isEmpty {
                bestLength = min(bestLength, end - start + 1)
                if 1...k ~= nums[start] {
                    needed.insert(nums[start]) // If removing this element misses any 1...k, add it back to needed
                }
                start += 1
            }
        }

        // If bestLength was updated, compute operations needed, otherwise return -1 or similar if not possible
        return bestLength == Int.max ? -1 : nums.count - bestLength
    }
}
